// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;



import '@openzeppelin/contracts/utils/Strings.sol';
import '@openzeppelin/contracts/utils/math/SafeMath.sol';


contract minerpunk  {
  using SafeMath for uint;
  using Strings for uint256;
  

 
   uint256 _currentNum;
 


  
  mapping(string => address)private _recommender;
 
  


  function viewCode() private view returns(string memory)  {
      string memory title = 'DCF'; 
      return string(abi.encodePacked(title, _currentNum.toString()));
  } 


  function setRecommender() private  {
      _recommender[viewCode()] = msg.sender;
      _currentNum = _currentNum.add(1);

  }  

  function ViewRecommender(string memory code)public view returns(address){
    return  _recommender[code];
  }

 






 
  





  

}

